const B2BScreen = ({ navigation }) => {
  const { width } = useWindowDimensions();
  const [drawerVisible, setDrawerVisible] = useState(false);

  useFocusEffect(
    useCallback(() => {
      return () => {
        // When navigating away (unfocused), close the drawer
        setDrawerVisible(false);
      };
    }, []),
  );

  return (
    <View style={styles.mainContainer}>
      {/* HEADER */}
      <CustomHeader
        onAvatarPress={() => setDrawerVisible(true)}
        onNotificationPress={() => navigation.navigate('Notification')}
      />

      {/* Search */}
      <View
        style={[styles.searchContainer, { marginHorizontal: width * 0.05 }]}
      >
        <TextInput
          placeholder="Search for business ,services ,products..."
          style={[styles.searchInput, { fontSize: width * 0.035 }]}
        />
        <Icon name="search" size={width * 0.07} color="red" />
      </View>
      <ScrollView showsVerticalScrollIndicator={false}>
        {/* TRENDING INDUSTRIES */}
        <Text style={styles.sectionTitle}>
          Trending <Text style={styles.highlight}>Industries</Text>
        </Text>
        <ScrollView horizontal showsHorizontalScrollIndicator={false}>
          {industries.map((item, index) => (
            <View key={index} style={styles.industryCard}>
              <Image source={{ uri: item.image }} style={styles.circleImage} />
              <Text style={styles.industryText}>{item.name}</Text>
            </View>
          ))}
        </ScrollView>

        {/* TRADE OFFERS */}
        <Text style={styles.sectionTitle}>
          Special <Text style={styles.highlight}>Trade Offers</Text>
        </Text>
        <ScrollView horizontal showsHorizontalScrollIndicator={false}>
          {tradeOffers.map((offer, index) => (
            <View key={index} style={styles.offerCard}>
              <Image source={{ uri: offer.image }} style={styles.offerImage} />
              <Text style={styles.offerTitle}>{offer.title}</Text>
              <Text style={styles.offerSubtitle}>{offer.subtitle}</Text>
            </View>
          ))}
        </ScrollView>

        {/* TOP SUPPLIERS */}
        <View style={styles.supplierHeader}>
          <Text style={styles.sectionTitle}>
            Top <Text style={styles.highlight}>Suppliers</Text>
          </Text>
          <Icon name="chevron-forward-outline" size={20} color="#000" />
        </View>

        <ScrollView horizontal showsHorizontalScrollIndicator={false}>
          {suppliers.map((supplier, index) => (
            <View key={index} style={styles.supplierCard}>
              <Image
                source={{ uri: supplier.image }}
                style={styles.supplierImage}
              />
              <Text style={styles.supplierText}>{supplier.name}</Text>
            </View>
          ))}
        </ScrollView>

        <View style={{ height: 80 }} />
        <SideDrawerModal
          visible={drawerVisible}
          onClose={() => setDrawerVisible(false)}
        />
      </ScrollView>
    </View>
  );
};

